import { NavLink } from 'react-router-dom'


export default function SignedOut() {
    return (
                <div>
                    <li><NavLink to="/login">Log In</NavLink></li>
                    <li><NavLink to="/signup">Sign Up</NavLink></li>
                </div>

    )
}
